                            Rating: <input className="form-control" type="number" name="rating" defaultValue={rating} /><br/>
                            <br/>
                            <input className="btn btn-primary" type="submit" name="" value="Submit Edits"/>
                        </form>
                    </div>
                </div>

            </Default>
        )
    }
}

// Export
